import React, { Component, Fragment, useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';
import * as ReactBootStrap from 'react-bootstrap';

const App = () => {
	const [drugs, setDrugs] = useState([]);
	const [loading, setLoading] = useState(false);
	const getDrugData = async () => {
		try {
			const data = await axios.get(
				"https://drugtargetcommons.fimm.fi/api/data/bioactivity/?format=json"
			);
			console.log(data);
			setDrugs(data.data.bioactivities);
			setLoading(true);
		} catch (e) {
			console.log(e)
		}
	};
	const columns = [
		{ dataField: "chembl_id", text: "Chembl ID" },
		{ dataField: "activity_comment", text: "Activity Comment" },
		{ dataField: "annotated", text: "Annotated" },
		{ dataField: "annotation_comments", text: "Annotation Comments" },
		{ dataField: "assay_cell_type", text: "Assay Cell Type" },
		{ dataField: "assay_format", text: "Assay Format" },
		{ dataField: "assay_sub_type", text: "Assay Sub-Type" },
		{ dataField: "assay_type", text: "Assay Type" },
		{ dataField: "authors", text: "Authors" },
		{ dataField: "compound_concentration_value", text: "Compount Concetration Value" },
		{ dataField: "compound_concentration_value_unit", text: "Compount Concetration Value Unit" },
		{ dataField: "compound_name", text: "Compound Name" },
		{ dataField: "detection_technology", text: "Detection Technology" },
		{ dataField: "endpoint_actionmode", text: "Endpoint Actionmode" },
		{ dataField: "endpoint_standard_relation", text: "Endpoint Standard Relation" }
	]

	useEffect(() => {
		getDrugData();
	}, []);

	return (
		<div className = "App">
		{loading ? (
			<BootstrapTable
				keyField="activity_comment"
				data={drugs}
				columns={columns}
				pagination={paginationFactory()}
				defaultSortDirection
			/>
		) : (
			<ReactBootStrap.Spinner animation="border" />
		)}
		</div>
	);
};

export default App;

